(1, 1, '2018-07-23 05:46:24', '2018-07-23 05:46:24', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'trash', 'open', 'open', '', 'hello-world__trashed', '', '', '2018-09-26 15:37:14', '2018-09-26 15:37:14', '', 0, 'http://golf-warehouse.vn/wp/?p=1', 0, 'post', '', 1),
(869, 1, '2018-09-12 07:53:22', '2018-09-12 07:53:22', '<div class=\"product-details section group wrapper\">\r\n<div class=\"col span_7_of_12\">\r\n<div class=\"product-details section group wrapper\">\r\n<div class=\"col span_7_of_12\">\r\n<div class=\"design-specs\">\r\n<h2 class=\"toggle\"><span class=\"header\">Design Details</span></h2>\r\n<div class=\"content mobile-toggle\"><span style=\"color: #0000ff;\">Realizing that spin is critical to optimizing the performance of a fairway wood, we\'ve integrated our NEW infinite Fast Track Technology to allow players the ability to precisely tune their launch and spin</span>performance.</div>\r\n</div>\r\n<div class=\"tech-specs\">\r\n<h2 class=\"toggle\">Tech Specs</h2>\r\n<ul>\r\n	<li><span style=\"color: #0000ff;\"><strong><em>NEW Infinite Fast Track:</em></strong> 15 gram adjustable weight on an unbounded track, yielding unlimited settings to precisely dial in spin and vertical launch parameters.</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong><em>Shockwave Sole: </em></strong>for HIGH COR low on the face for increased ball speeds across the entire face.</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong>NEW More Stable Design:</strong> for our largest sweet area yet</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong>Waffle Crown:</strong> promotes forward and low COG for ease of launch.</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong>Quick Switch Adaptor:</strong> +/- 2 degrees of loft adjustability.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<h2 class=\"toggle\"> </h2>', 'JPX-900 FW ADJ. #5 SPEEDER EVOLUTION II', '', 'publish', 'closed', 'closed', '', 'jpx-900-fw-adj-5-speeder-evolution-ii', '', '', '2018-09-12 07:54:41', '2018-09-12 07:54:41', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=869', 0, 'clubs', '', 0),
