(1075, 1, '2018-09-17 03:38:04', '2018-09-17 03:38:04', '<h4>MIZUNO GX FORGED IRON</h4>\r\n<p>Introducing the New Mizuno GX Forged Iron for 2018. The Game Changer iron made by mizuno using boron infused steel.</p>\r\n<p>At first glance,  the GX Forged Irons look very similar to the 918 from their Mizuno Pro line up.   The 918 irons are the most forgiving of the Mizuno Pro forged irons but the new GX Forged Irons are even more forgiving.</p>\r\n<p>When you look at the lofts,  they are about 2 clubs stronger compared to their MP-66.   At approximately  84.5mm,  the length from toe to heel are the longest yet for a full forged Mizuno iron.    The undercut on the pocket cavity goes deeper and wider than its predecessor by using a new pocket called \"Dual T Slot. \"   For the longer irons 6 &amp; 7 ,  they also embedded a 10g tungsten weight low in the toe to help create a larger sweet spot.</p>\r\n<p>They incorporate a forging technique to abruptly cool only the face which produces a harder face section  allowing them to make the face thinner and generate higher COR while maintaining the mild feel at impact signature to Mizuno Grain Flow forged Irons.</p>\r\n<p>Highly forgiving,  improved distance performance,   signature Mizuno forged feel...   I\'m not seeing any weaknesses to these irons.   If you are currently a Muscle Back player ... sure these won\'t look anything like them and you may not like the larger size or the slight offset of these irons.    But for many of you who seek consistency in their game but don\'t like the feel of cast stainless steel Game Improvement irons out there,   look no further, Mizuno GX Forged irons are for you.   Standard shaft offerings are the MFUSION graphite shaft and Nippon 950GH HT steel shafts.</p>', 'GX FORGED IRON I#5-PW MFUSION I SR I#5-PW', '', 'publish', 'closed', 'closed', '', 'gx-forged-iron-i5-pw-mfusion-i-sr-i5-pw', '', '', '2018-09-18 15:39:34', '2018-09-18 15:39:34', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=1075', 0, 'clubs', '', 0),
(95, 1, '2018-08-15 06:27:16', '2018-08-15 06:27:16', '<ul>\r\n 	<li style=\"font-weight: 400;\">Nike Dry fabric helps you stay dry and comfortable.</li>\r\n 	<li style=\"font-weight: 400;\">Regular fit provides a relaxed, comfortable feel.</li>\r\n 	<li style=\"font-weight: 400;\">Rolled-forward shoulder seams allow natural range of motion.</li>\r\n 	<li style=\"font-weight: 400;\">Collar is ribbed to help prevent curling.</li>\r\n 	<li style=\"font-weight: 400;\">2-button placket provides a customizable fit.</li>\r\n</ul>\r\n<p style=\"font-weight: 400;\">100% POLYESTER</p>', 'M NK DRY VICTRY POLO SOLID', '', 'publish', 'closed', 'closed', '', 'm-nk-dry-victry-polo-solid', '', '', '2018-09-05 06:19:27', '2018-09-05 06:19:27', '', 0, 'http://golf-warehouse.vn/wp/?post_type=apparel&#038;p=95', 0, 'apparel', '', 0),
