(236, 1, '2018-08-21 07:54:27', '2018-08-21 07:54:27', '<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n	<li><span class=\"a-list-item\">2pc structure: 1 core 1 cover and micro dimples</span></li>\r\n	<li><span class=\"a-list-item\">Cover - Multi blended polymer, highly resilient polymer provides a higher initial ball speed</span></li>\r\n	<li><span class=\"a-list-item\">Core - Highly resilient core, soft and highly resilient core promotes less spin which leads to increased distance</span></li>\r\n	<li><span class=\"a-list-item\">Dimple - 512 Dual energy dimple design, micro dimples enable extra airtime for more carry</span></li>\r\n	<li><span class=\"a-list-item\">Micro Dimple - For Extra airtime, micro dimplies take effect in dscent zone</span></li>\r\n</ul>', '18SS JPX BALL', '', 'publish', 'closed', 'closed', '', '18ss-jpx-ball', '', '', '2018-09-10 04:41:47', '2018-09-10 04:41:47', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=236', 0, 'accessories', '', 0),
