(238, 1, '2018-08-21 08:03:57', '2018-08-21 08:03:57', '<p class=\"thin-font\"><strong>MIZUNO JPX-S</strong></p>\r\n<p class=\"thin-font\"><em>The Balanced Performance ball with Micro Dimples</em></p>\r\n<p class=\"thin-font\">The new JPX-s is a soft compression edition of Mizuno’s 3 piece ball – producing a balanced performance for a wider range of swing speeds. Mizuno’s engineers discovered that a softening of the core not only improved the feel of the JPX-s at impact, but also increased initial ball speed for the majority of players.</p>\r\n<p class=\"thin-font\">An enhanced version of Mizuno’s Dimple-Cluster design improves the JPX-s aerodynamics, converting mph into yards. With 54 extra micro dimples (566 dimples in total), the new JPX-s has an increased ability to maintain its flight for longer – the micro dimples taking effect at lower ball speeds. The uniquely aerodynamic cover design was conceived and tested in Mizuno’s own air tunnel.</p>\r\n<p class=\"thin-font\">“We call this Balanced Performance as every measurable performance aspect of the JPX-s has evolved without sacrifice of another – speed, feel, spin, aerodynamics and durability,” commented Tetsuya Kanayama, Director of Mizuno R&amp;D.</p>\r\n<p class=\"thin-font\">Testing with slightly higher swing speeds also showed some unexpected results. Nobuhito Sato from the Japan Tour carried the JPX-s around 255 yards – on average 18 yards longer than his normal tour ball / MP-s with the driver. A recent Golf Digest report suggested that only sub 5 hcp players averaged a total driving distance of more than 250 yards, with the overall average at just 219.55 yards.</p>\r\n<p class=\"thin-font\">“Although Sato isn’t a long hitter by tour standards – his driver clubhead speed of 102 mph is comfortably more than most amateurs.” observed Alex Thorne, European Tour Operations manager. “Proving that this softer compression is going to produce greater yardage for the majority of players.”</p>\r\n<p class=\"thin-font\">Balanced Performance: Speed, feel, aerodynamics and durability enhanced together.<br />\r\nSofter compression: Creates greater ball speed for the majority of amateur swings<br />\r\n566 Micro Dimple Design: Increased hang time past the apex of ball flight.</p>\r\n<h3> </h3>', 'MIZUNO 17JPX-S WHITE', '', 'publish', 'closed', 'closed', '', 'mizuno-17jpx-s-white', '', '', '2018-09-10 04:39:10', '2018-09-10 04:39:10', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=238', 0, 'accessories', '', 0),
