(278, 1, '2018-08-27 03:33:58', '2018-08-27 03:33:58', '<p>&nbsp;</p>\r\n<ul>\r\n	<li>Powered by a Nike Flight Plate, Men\'s Nike Air Zoom Precision Golf Shoe helps maximize the responsiveness of Zoom Air technology.</li>\r\n	<li>A premium, waterproof leather upper delivers a classic look while a hybrid outsole design optimizes traction.</li>\r\n	<li>Nike Flight Plate helps maximize the responsiveness of Zoom Air technology.</li>\r\n	<li>Premium, waterproof leather upper helps keep your feet dry.</li>\r\n	<li>Integrated Traction on the outsole enhances grip.</li>\r\n	<li>Foam-backed synthetic rand cups the foot for lateral stability.</li>\r\n	<li>8mm Fitsole sockliner provides plush cushioning directly underfoot.</li>\r\n	<li>“All day comfort. Tee to green.” is printed on the sockliner.</li>\r\n	<li>Hybrid outsole design features Integrated Traction under the ball of the foot and removable spikes around the</li>\r\n	<li>lateral side and heel for optimal gripping power.</li>\r\n	<li>Removable CHAMP® Zarma Tour® golf spikes twist and lock into a CHAMP® Slim-LOK® system for exceptional traction and</li>\r\n	<li>enhanced ground feel on a variety of surfaces.</li>\r\n	<li>Waterproofing features a 2-year warranty.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'NIKE AIR ZOOM PRECISION (W)', '', 'publish', 'closed', 'closed', '', 'nike-air-zoom-precision-w', '', '', '2018-09-10 06:50:21', '2018-09-10 06:50:21', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=278', 0, 'shoes', '', 0),
