(309, 1, '2018-08-27 07:54:35', '2018-08-27 07:54:35', '<p>Nike Golf WIndsheer Lite Umbrella 62\". Lightweight design features 100% nylon upper and lower canopies, a durable fiberglass shaft and a flexible FRP rib frame. Wind-Release System, featuring the patented Windlock System which allows wind to escape between upper and lower canopies minimizing inversion during storms and high winds. Dynamic striped print creates a sleek high performance look. A coordinated coloured frame adds a splash of color to the underside of the umbrella. Patented safety-runner allows for smooth opening and closing. Custom molded two-color rubber handle is made to fit comfortably in your hand or securely in your push cart. Swoosh design trademark printed on front and back panels.</p>', '62 WINDSHEER LITE UMBRELLA BLACK/ PINK POW', '', 'publish', 'closed', 'closed', '', '62-windsheer-lite-umbrella-black-pink-pow', '', '', '2018-09-10 04:03:17', '2018-09-10 04:03:17', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=309', 0, 'accessories', '', 0),
