(350, 1, '2018-08-28 04:40:25', '2018-08-28 04:40:25', '<p>ULTRA-LIGHTWEIGHT AND FLEXIBLE</p>\r\n<p>The Nike FI Flex (Wide) Men\'s Golf Shoe features a Nike Free-inspired outsole that flexes with your foot for a smooth, natural feel, while lightweight cushioning keeps you comfortable through the eighteenth hole.</p>\r\n<p>Naturally Flexible</p>\r\n<p>Deep grooves on the outsole flex and expand with the natural movement of your foot to help support a smooth swing every time.</p>\r\n<p>Plush Cushioning</p>\r\n<p>A lightweight Phylon midsole provides soft cushioning underfoot, while a foam collar and tongue surrounds the top of your foot and ankle in plush comfort.</p>\r\n<p>Weather Protection</p>\r\n<p>A nylon upper has a DWR (durable, water-repellent) finish to help keep your feet dry in wet, rainy conditions. Ripstop fabric is added to the forefoot for lasting durability.</p>\r\n<p>More Details</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n	<li>Wider footbed accommodates wide feet</li>\r\n	<li>No-sew overlays keeps the shoe lightweight Integrated</li>\r\n	<li>Traction pattern for surface grip in all conditions</li>\r\n	<li>Heel counter helps promote stability</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'NIKE FI FLEX (WIDE)', '', 'publish', 'closed', 'closed', '', 'nike-fi-flex-wide', '', '', '2018-09-10 06:48:08', '2018-09-10 06:48:08', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=350', 0, 'shoes', '', 0),
