(355, 1, '2018-08-28 06:24:17', '2018-08-28 06:24:17', '<p>The Nike Explorer 2 Men\'s Golf Shoe helps stabilize and cushion your foot with an innovative debossed upper and soft, foam midsole. An aggressive traction pattern provides excellent grip on a variety of surfaces</p>\r\n<p><b>Features:</b></p>\r\n<ul>\r\n	<li>Water-resistant synthetic laminate upper is lightweight and helps keep feet dry on the course</li>\r\n	<li>Debossed lines add structure and support</li>\r\n	<li>Phylon midsole for lightweight cushioning</li>\r\n	<li>Rubber integrated traction for stability and excellent grip</li>\r\n</ul>', 'NIKE EXPLORER 2 (WIDE)', '', 'publish', 'closed', 'closed', '', 'nike-explorer-2-wide', '', '', '2018-09-10 06:47:46', '2018-09-10 06:47:46', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=355', 0, 'shoes', '', 0),
