(419, 1, '2018-08-28 08:37:33', '2018-08-28 08:37:33', '<div class=\"ng-binding ng-scope\">Dri-FIT technology and perforated leather provide a responsive feel and breathable comfort in the Women\'s Nike Tech Golf Glove. Spandex fabric throughout stretches with you to allow natural range of motion.</div>\r\n<ul>\r\n	<li class=\"ng-binding ng-scope\">Dri-FIT technology helps keep you dry and comfortable.</li>\r\n	<li class=\"ng-binding ng-scope\">Soft, durable leather provides a responsive feel and grip.</li>\r\n	<li class=\"ng-binding ng-scope\">Tapered closure allows natural range of motion.</li>\r\n	<li class=\"ng-binding ng-scope\">Low-profile, hook-and-loop closure provides an adjustable fit.</li>\r\n	<li class=\"ng-binding ng-scope\">Spandex fabric on the back of the hand stretches to provide excellent mobility.</li>\r\n	<li>\r\n<div class=\"ng-binding ng-scope\">60% CABRETTA LEATHER 40% LYCRA</div>\r\n</li>\r\n</ul>', 'NIKE TECH GLOVE WHL', '', 'publish', 'closed', 'closed', '', 'nike-tech-glove-whl', '', '', '2018-09-06 02:39:00', '2018-09-06 02:39:00', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=419', 0, 'accessories', '', 0),
