(422, 1, '2018-08-28 09:43:08', '2018-08-28 09:43:08', '<p>Dri-FIT technology and perforated leather provide a responsive feel and<br />\r\nbreathable comfort in the Men\'s Nike Tech Golf Glove (Left Regular).<br />\r\nSpandex fabric throughout stretches with you to allow natural range of<br />\r\nmotion.<br />\r\n- Dri-FIT technology helps keep you dry and comfortable.<br />\r\n- Soft, durable leather provides a responsive feel and grip.<br />\r\n- Tapered closure allows natural range of motion.<br />\r\n- Low-profile, hook-and-loop closure provides an adjustable fit.<br />\r\n- Spandex fabric on the back of the hand stretches to provide excellent<br />\r\nmobility.<br />\r\n- 60% Cabretta Leather, 40% Lycra</p>', 'NIKE TECH GLOVE REG LEFT HAND', '', 'publish', 'closed', 'closed', '', 'nike-tech-glove-reg-left-hand', '', '', '2018-09-06 02:38:13', '2018-09-06 02:38:13', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=422', 0, 'accessories', '', 0),
