(445, 1, '2018-08-29 03:52:53', '2018-08-29 03:52:53', '<div class=\"ng-binding ng-scope\">Unisex Nike Golf Visor features the sweat-wicking power of Dri-FIT technology to help you stay dry. Its absorbent sweatband and adjustable back closure offer soft, customizable comfort.</div>\r\n<div class=\"ng-scope\">\r\n<ul>\r\n 	<li class=\"ng-binding ng-scope\">Dri-FIT technology helps keep you dry and comfortable.</li>\r\n 	<li class=\"ng-binding ng-scope\">Soft hook-and-loop closure lets you adjust your fit.</li>\r\n 	<li class=\"ng-binding ng-scope\">Terry sweatband is soft and absorbent.</li>\r\n 	<li class=\"ng-binding ng-scope\">Swoosh design trademark is embroidered on the front panel.</li>\r\n 	<li class=\"ng-binding ng-scope\">100% POLYESTER</li>\r\n</ul>\r\n</div>', 'NIKE VISOR CORE', '', 'publish', 'closed', 'closed', '', 'nike-visor-core', '', '', '2018-09-05 03:18:01', '2018-09-05 03:18:01', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=445', 0, 'accessories', '', 0),
