(463, 1, '2018-08-29 06:51:23', '2018-08-29 06:51:23', '<p style=\"font-weight: 400;\">Unisex Nike Legacy91 Golf Hat delivers a classic look with an adjustable closure and Dri-FIT technology to help you stay dry and comfortable. The front panels are left blank for easy customization.</p>\r\n<ul>\r\n	<li style=\"font-weight: 400;\">Dri-FIT technology helps keep you dry and comfortable.</li>\r\n	<li style=\"font-weight: 400;\">Soft hook-and-loop closure lets you adjust your fit.</li>\r\n	<li style=\"font-weight: 400;\">Embroidered eyelets help enhance breathability.</li>\r\n	<li style=\"font-weight: 400;\">Terry sweatband is soft and absorbent.</li>\r\n	<li style=\"font-weight: 400;\">Designed to let you easily apply custom graphics, like a crest or logo.</li>\r\n</ul>\r\n<p style=\"font-weight: 400;\">100% POLYESTER</p>', 'UNISEX NIKE LEGACY 91 CAP TECH CUSTOM', '', 'publish', 'closed', 'closed', '', 'unisex-nike-legacy-91-cap-tech-custom', '', '', '2018-09-06 02:01:47', '2018-09-06 02:01:47', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=463', 0, 'accessories', '', 0),
