(466, 1, '2018-08-29 07:05:30', '2018-08-29 07:05:30', '<p style=\"font-weight: 400;\">Unisex Nike Legacy91 Golf Hat helps you stay focused on your game with sweat-wicking, breathable fabric and a quick-adjust closure that lets you easily customize your fit.</p>\r\n<ul>\r\n	<li style=\"font-weight: 400;\">Dri-FIT technology helps keep you dry and comfortable.</li>\r\n	<li style=\"font-weight: 400;\">Embroidered eyelets help enhance breathability.</li>\r\n	<li style=\"font-weight: 400;\">Laser perforated hook-and-loop closure for a customizable fit.</li>\r\n	<li style=\"font-weight: 400;\">Thumb tab allows you to easily adjust your fit.</li>\r\n	<li style=\"font-weight: 400;\">Terry sweatband is soft and absorbent.</li>\r\n</ul>\r\n<p style=\"font-weight: 400;\">100% POLYESTER</p>', 'UNISEX NIKE LEGACY 91 CAP TECH', '', 'publish', 'closed', 'closed', '', 'unisex-nike-legacy-91-cap-tech', '', '', '2018-09-06 02:00:24', '2018-09-06 02:00:24', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=466', 0, 'accessories', '', 0),
