(468, 1, '2018-08-29 13:12:30', '2018-08-29 13:12:30', '<h1>GT-180 Fairway Wood\r\nThe New Law of Gravity</h1>\r\nThe ultimate customizable fairway wood – with ability to vastly reduce or increase spin rates as the situation dictates. An evolution of both the Mizuno Wave sole and sliding weight – reduces the lower end of spin rates for a more efficient trajectory at higher ball speeds.\r\n<ul>\r\n 	<li>Also available in a TS (tour style) more compact, lower lofted head.</li>\r\n 	<li>Amplified first wave: Pushes weight low and forwards for a flatter trajectory, in addition to creating more ball speed.</li>\r\n 	<li>Faster 1770 Maraging Steel Face: A thinner, more responsive face for increased ball speeds.</li>\r\n 	<li>17 grams of sliding weight: Creates a wider potential span of spin rates to fine tune your ball flight.</li>\r\n 	<li>Efficient low spin design: An Internal Waffle Crown saves weight to be reallocated low and forward.</li>\r\n 	<li>New shaft options: Expanded line of high-end shafts fitted without additional charge.</li>\r\n 	<li>Quick Switch Adjustable Hosel:  Allows 4 degrees of loft adjustment and 3 degrees of lie adjustment to match your unique launch and visual preference.</li>\r\n</ul>', 'GT 180 #3 FW ADJUSTABLE TENSEI BLUE 60S #3', '', 'publish', 'closed', 'closed', '', 'gt-180-3-fw-adjustable-tensei-blue-60s-3', '', '', '2018-08-30 10:27:54', '2018-08-30 10:27:54', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=468', 0, 'clubs', '', 0),
