(471, 1, '2018-08-29 07:22:46', '2018-08-29 07:22:46', '<p>The popular Nike Aerobill Classic 99 cap returns for 2018 and now features a raised silicone Swoosh logo to the front to provide a 3D effect - a key design update which improves the style perfectly. The Nike Aerobill technology helps to provide a lightweight feel and increase reliability over time, while added four way stretch offers maximum comfort. The moisture wicking Dri-FIT technology combines well with laser perforated panels to maximise breathability, all helping to make this iconic golf cap a true essential to complete the Nike look.</p>\r\n<p>- Sized<br />\r\n- Classic Curved Brim<br />\r\n- Aerobill Peak<br />\r\n- 4 Way Stretch<br />\r\n- Dri-Fit Technology<br />\r\n- Laser Perforations<br />\r\n- 3D Silicone Swoosh Logo at Front<br />\r\n- Swoosh Logo at Rear</p>\r\n<p><strong>Material</strong>: 88% Polyester 12% Spandex</p>', 'UNISEX NIKE AROBILL CL99 CAP PERF', '', 'publish', 'closed', 'closed', '', 'unisex-nike-arobill-cl99-cap-perf', '', '', '2018-09-06 01:54:56', '2018-09-06 01:54:56', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=471', 0, 'accessories', '', 0),
