(483, 1, '2018-08-29 07:31:25', '2018-08-29 07:31:25', '<p>Unisex Nike Cushioned No-Show Golf Socks<br />\r\nUnisex Nike Cushioned No-Show Golf Socks help keep you cool and comfortable so you can focus on your round. Mesh on the top combined with sweat-wicking support increases ventilation, while cushioning in key areas helps absorb impact.</p>\r\n<ul>\r\n	<li>Dri-FIT technology helps you stay dry and comfortable.</li>\r\n	<li>Zonal cushioning offers lasting comfort.</li>\r\n	<li>Anatomical left/right design for a natural fit.</li>\r\n	<li>Mesh at the top of the foot adds ventilation.</li>\r\n	<li>Arch support stretches around the midfoot.</li>\r\n	<li>100% TEXTILE</li>\r\n</ul>', 'UNISEX NIKE GOLF CUSH NS', '', 'publish', 'closed', 'closed', '', 'unisex-nike-golf-cush-ns', '', '', '2018-09-06 01:47:46', '2018-09-06 01:47:46', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=483', 0, 'accessories', '', 0),
