(497, 1, '2018-08-29 08:04:09', '2018-08-29 08:04:09', '<p>The Nike Golf Sport Duffle III Bag has a specialized strap system that lets you carry gear three different ways. Separate wet/dry and shoe pockets complement the main zip compartment with versatile storage options.</p>\r\n<ul>\r\n	<li>Tri-carry strap system for versatile, comfortable carrying options.</li>\r\n	<li>Zip main compartment with interior organizer for secure storage and organization.</li>\r\n	<li>Separate shoe compartment and wet/dry pocket for specialized storage.</li>\r\n	<li>Water-resistant fabric to help keep gear dry and protected.</li>\r\n	<li>Roll-top entry with side release buckle.</li>\r\n	<li>Imported</li>\r\n	<li>Material: 100% polyester</li>\r\n</ul>', 'NIKE GOLF SPORT DUFFLE III', '', 'publish', 'closed', 'closed', '', 'nike-golf-sport-duffle-iii', '', '', '2018-09-10 06:13:48', '2018-09-10 06:13:48', '', 0, 'http://golf-warehouse.vn/wp/?post_type=bag&#038;p=497', 0, 'bag', '', 0),
