(537, 1, '2018-08-30 09:58:48', '2018-08-30 09:58:48', '<h3>PRODUCT DETAIL</h3>\n<div class=\"product_info_text\">\n\nThe new JPX900 uses a raft of our best design ideas to send the ball a really, really long way. It’s built on consistently high ball speeds, that don’t drop off on miss-hits. Added to that, the JPX900’s shallower profile looks easy to hit, sending all the right messages to your brain. The JPX900 is also our most adaptable driver ever – so you can create the spin rates and launch angle best suited to your ball speed (even if it’s probably a bit faster than you’re used to).\n\nFeature:\n1. Fast off the face\nOur Engineers didn\'t rest until the JPX 900 produced the fastest ball speeds of any driver coming through our test centre (they test everything). A newly configured multi thickness face and clever strengthening of key areas means the JPX900 gives a base for the longest drivers you\'ll hit.\n\n2. Looks easier to hit - and it is\nOur professionals told us that even they wanted drivers that looked easy to hit. So we changed the profile to be longer, wider and much shallower than normal (for a tour used driver). We also found lots of little improvements that you can\'t see to make the ball speed more consistent from of centre hits ( the other thing our players asked for)\n\n3.Convert mph into yards\nOptimising your launch angle/spin rate can make a difference of 20/30 yards. With 2 eight gram weights and three Fast Tracks ( the middle one slides front to back), the JPX900 gives more player the opportunity to max out those parametes. The toe and heel port allows spin/launch to be adjusted alongside fade/draw bias. The weights can alos be removed completely.\n\n4. Move the loft and face angle\nOur Quick Switch hosel means you can change the loft (or switch shafts ) at the turn of a key. Combined with a face angle prop on the sole - you can set the JPX900 to any loft or look that suits your swing and eye.\n\n&nbsp;\n\n</div>', 'JPX-900 DRIVER ADJUSTBALE SPEEDER EVOLUTION II FLEX 569R #1', '', 'inherit', 'closed', 'closed', '', '527-autosave-v1', '', '', '2018-08-30 09:58:48', '2018-08-30 09:58:48', '', 527, 'http://golf-warehouse.vn/wp/uncategorized/527-autosave-v1/', 0, 'revision', '', 0),
