(541, 1, '2018-08-31 06:50:36', '2018-08-31 06:50:36', '<p>the Nike Precision Jr. Kids\' Golf Shoe features full-length foam cushioning for lightweight comfort and a stable feel at the course and range. Its outsole has an Integrated Traction pattern for enhanced grip on a variety of surfaces.</p>\r\n<p>&nbsp;</p>\r\n<p><b class=\"u-bold\">Benefits</b></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n	<li>Synthetic leather upper is water-resistant</li>\r\n	<li>Integrated traction pattern enhances grip</li>\r\n	<li>Full-length foam cushioning for lightweight comfort</li>\r\n	<li>Inner sleeve for a sock-like feel</li>\r\n	<li>Rubber outsole for durability</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'NIKE PRECISION JUNIOR', '', 'publish', 'closed', 'closed', '', 'nike-precision-junior', '', '', '2018-09-10 06:30:28', '2018-09-10 06:30:28', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=541', 0, 'shoes', '', 0),
