(548, 1, '2018-08-31 07:08:21', '2018-08-31 07:08:21', '<p>• Zoom Air unit in the heel offers responsive cushioning<br />\r\n• Synthetic leather upper is durable and waterproof<br />\r\n• Partial internal bootie provides a snug, sock-like fit<br />\r\n• Dual-pull lacing helps lock down the midfoot for a customizable and supportive fit<br />\r\n• Die-cut EVA sockliner provides cushioning and support<br />\r\n• Removable SoftSpikes<sup>®</sup> Pulsar<sup>®</sup> golf spikes twist and lock into a SoftSpikes® Tour-Lock<sup>™</sup> system for traction and enhanced ground feel on a variety of surfaces<br />\r\n• Hybrid outsole design features Integrated Traction under the ball of the foot and removable spikes around the lateral side and heel for optimal gripping power<br />\r\n• Waterproofing features a 1-year warranty</p>', 'WOMENS NIKE AIR ZOOM ACCURATE(W)', '', 'publish', 'closed', 'closed', '', 'womens-nike-air-zoom-accuratew', '', '', '2018-09-30 00:51:53', '2018-09-30 00:51:53', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=548', 0, 'shoes', '', 0),
