(552, 1, '2018-08-31 07:12:35', '2018-08-31 07:12:35', '<div class=\"ng-binding ng-scope\">Women\'s Nike Explorer 2 Golf Shoe offers the lightweight comfort of Phylon cushioning and the added stability of a strategically debossed upper. Its durable rubber outsole features an aggressive Integrated Traction system for grip on a variety of surfaces.</div>\r\n<div class=\"ng-scope\">\r\n<ul>\r\n	<li class=\"ng-binding ng-scope\">Debossed lines on the upper provide added structure and a stable feel.</li>\r\n	<li class=\"ng-binding ng-scope\">Aggressive rubber outsole delivers green-friendly traction for a variety of conditions.</li>\r\n	<li class=\"ng-binding ng-scope\">Water-repellent upper helps keep you dry.</li>\r\n	<li class=\"ng-binding ng-scope\">Full-length Phylon provides lightweight comfort and a stable feel.</li>\r\n	<li class=\"ng-binding ng-scope\">Pull tab on the tongue provides easy on and off.</li>\r\n	<li class=\"ng-binding ng-scope\">Synthetic leather upper is durable and helps reduce staining.</li>\r\n	<li class=\"ng-binding ng-scope\">Synthetic laminate is lightweight and durable</li>\r\n</ul>\r\n</div>', 'WOMENS NIKE EXPLORER 2 (W)', '', 'publish', 'closed', 'closed', '', 'womens-nike-explorer-2-w', '', '', '2018-09-10 06:28:44', '2018-09-10 06:28:44', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=552', 0, 'shoes', '', 0),
