(556, 1, '2018-09-04 02:29:52', '2018-09-04 02:29:52', '<div class=\"ng-binding ng-scope\">Nike Roshe G Women\'s Golf Shoe features a pressure-mapped outsole that provides traction in key zones. Inspired by a Nike icon, the mesh upper offers breathability and a modern look, while the soft, flexible, foam midsole cushions every step.</div>\r\n<div class=\"ng-scope\">\r\n<ul>\r\n	<li class=\"ng-binding ng-scope\">Pressure-mapped outsole provides traction in key zones.</li>\r\n	<li class=\"ng-binding ng-scope\">Iconic mesh upper delivers breathability and style.</li>\r\n	<li class=\"ng-binding ng-scope\">Injected midsole delivers soft, lightweight cushioning.</li>\r\n	<li class=\"ng-binding ng-scope\">Elastic gusset on the tongue helps keep out debris.</li>\r\n	<li class=\"ng-binding ng-scope\">Pull tabs on the heel and tongue offer easy on and off.</li>\r\n	<li class=\"ng-binding ng-scope\">Generative design uses an algorithm to identify patterns and sizes that optimize stability and traction.</li>\r\n	<li class=\"ng-binding ng-scope\">Cupsole-like design offers flexible, low-profile support and a stable feel</li>\r\n</ul>\r\n</div>', 'WOMENS ROSHE G', '', 'publish', 'closed', 'closed', '', 'womens-roshe-g', '', '', '2018-09-10 06:27:37', '2018-09-10 06:27:37', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=556', 0, 'shoes', '', 0),
