(568, 1, '2018-09-04 02:50:41', '2018-09-04 02:50:41', '<p>&nbsp;</p>\r\n<ul>\r\n	<li>Featuring Flywire technology and Lunarlon foam, Women\'s Nike Lunar Command 2 Golf Shoe provides lightweight cushioning and a locked-down fit.</li>\r\n	<li>It features a technical TPU midfoot shank for enhanced ground feel on a variety of surfaces.</li>\r\n	<li>Flywire technology integrates with the laces for a dynamic, supportive fit.</li>\r\n	<li>Aggressive outsole design delivers green-friendly traction for a variety of conditions.</li>\r\n	<li>Lunarlon cushioning for a responsive heel to toe transition.</li>\r\n	<li>Textile upper is lightweight and durable.</li>\r\n	<li>Waterproof membrane in the upper helps keep your feet dry.</li>\r\n	<li>Midfoot shank made from technical TPU helps generate a light and stable feel.</li>\r\n	<li>7 removable CHAMP® PiviX golf spikes twist and lock into a CHAMP® SLIM-Lok system for exceptional traction and enhanced ground feel on a variety of surfaces.</li>\r\n	<li>Waterproofing features a 1-year warranty</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'WOMEN NIKE LUNAR COMMAND 2 W', '', 'publish', 'closed', 'closed', '', 'women-nike-lunar-command-2-w', '', '', '2018-09-10 06:27:10', '2018-09-10 06:27:10', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=568', 0, 'shoes', '', 0),
