(574, 1, '2018-09-04 03:07:01', '2018-09-04 03:07:01', '<ul>\r\n	<li>Leather and synthetic leather construction for durability and support</li>\r\n	<li>Full-length Phylon foam midsole provides supportive comfort</li>\r\n	<li>Rubber cupsole for a classic look and durability</li>\r\n	<li>Pressure-mapped outsole for targeted traction</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'WOMEN NIKE COURSE CLASSIC (W)', '', 'publish', 'closed', 'closed', '', 'women-nike-course-claassic-w', '', '', '2018-09-10 06:26:41', '2018-09-10 06:26:41', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=574', 0, 'shoes', '', 0),
(579, 1, '2018-09-04 03:22:45', '2018-09-04 03:22:45', '<p>The Nike FI Flex (Wide) Women\'s Golf Shoe flexes with your foot for a smooth, natural feel and features lightweight cushioning to help keep you comfortable through the eighteenth hole.</p>\r\n<p>Naturally Flexible</p>\r\n<p>Deep grooves on the outsole flex and expand with the natural movement of your foot to help support a smooth swing every time.</p>\r\n<p>Plush Cushioning</p>\r\n<p>A lightweight Phylon midsole provides soft cushioning underfoot, while a foam collar and tongue surrounds the top of your foot and ankle in plush comfort.</p>\r\n<p>Weather Protection</p>\r\n<p>A nylon upper has a DWR (durable, water-repellent) finish to help keep your feet dry in wet, rainy conditions. Ripstop fabric is added to the forefoot for lasting durability.</p>\r\n<p>More Details</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n	<li>Wider footbed accommodates wide feet</li>\r\n	<li>No-sew overlays keeps the shoe lightweight</li>\r\n	<li>Integrated Traction pattern for surface grip in all conditions</li>\r\n	<li>Heel counter helps promote stability</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'WOMEN NIKE FI FLEX (WIDE)', '', 'publish', 'closed', 'closed', '', 'women-nike-fi-flex-wide', '', '', '2018-09-10 06:25:23', '2018-09-10 06:25:23', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=579', 0, 'shoes', '', 0),
