(792, 1, '2018-09-12 03:56:52', '2018-09-12 03:56:52', '<center>\r\n<h3>S18 Wedge</h3>\r\n</center>\r\n<p>The S18 wedge is the newest member in our family of performance wedges with an advanced center of gravity positioning. In the higher lofts, mass is shifted up the blade delivering more consistent spin rates on strikes from high on the clubface (common with more extreme lofts). A true specialist wedge in every aspect (sole grind, profile, beveled top line and groove depth) from the 46-degree pitching wedge replacement to the 62-degree lob wedge in a midsize, rounded profile. Grain Flow Forged with Boron for grooves that stay sharper longer.</p>\r\n<p>&nbsp;</p>', 'S18 Wedge *WHITE STAIN DYNAMIC GOLD WEDGE', '', 'publish', 'closed', 'closed', '', 's18-wedge-white-stain-dynamic-gold-wedge', '', '', '2018-09-12 04:07:33', '2018-09-12 04:07:33', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=792', 0, 'clubs', '', 0),
