(627, 1, '2018-09-04 08:11:55', '2018-09-04 08:11:55', '<p>• Cushioning while suppressing movement in the inward and outward directions, reducing the burden on the feet. It softens the shock on the foot at the time of swing and walking, while suppressing lateral shift and wobbling. It maintains excellent cushioning and stability.<br />\r\n• Midsole materialt is light weight and cushioning. Material improves cushioning performance by about 15% compared to conventional material, even though it is lightweight. Reduce tiredness and softens the burden on the foot when swinging and walking.<br />\r\n• Outsole material excellent in durability. Compared with rubber material, it adopts \"X10 rubber\" which improved durability by about 80%</p>', 'WAVE CADENCE LIME', '', 'publish', 'closed', 'closed', '', 'wave-cadence-lime', '', '', '2018-09-10 06:21:41', '2018-09-10 06:21:41', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=627', 0, 'shoes', '', 0),
