(755, 1, '2018-09-10 03:08:29', '2018-09-10 03:08:29', '<h2><span style=\"font-size: 12pt;\">Breathable golf cap.</span></h2>\n<div id=\"product-description\" class=\"tabContent\">\n<div align=\"justify\">\n<p><span style=\"font-size: 12pt;\">The hat delivers a classic look with an adjustable closure and Dri-FIT technology to help you stay dry and comfortable. The front panels are left blank for easy customization.</span></p>\n<ul>\n	<li><span style=\"font-size: 12pt;\">Dri-FIT technology helps keep you dry and comfortable.</span></li>\n	<li><span style=\"font-size: 12pt;\">Soft hook-and-loop closure lets you adjust your fit.</span></li>\n	<li><span style=\"font-size: 12pt;\">Embroidered eyelets help enhance breathability.</span></li>\n	<li><span style=\"font-size: 12pt;\">Ripstop polyester material adds durability.</span></li>\n	<li><span style=\"font-size: 12pt;\">Designed to let you easily apply custom graphics, like a crest or logo.</span></li>\n</ul>\n<p><span style=\"font-size: 12pt;\">Material</span><br />\n<span style=\"font-size: 12pt;\">100% polyester</span><br />\n<span style=\"font-size: 12pt;\">Lining: 100% polyester</span></p>\n</div>\n</div>', 'NIKE LEGACY91 CUSTOM TECH CAP', '', 'inherit', 'closed', 'closed', '', '394-autosave-v1', '', '', '2018-09-10 03:08:29', '2018-09-10 03:08:29', '', 394, 'http://golf-warehouse.vn/wp/uncategorized/394-autosave-v1/', 0, 'revision', '', 0),
