(757, 1, '2018-09-10 03:20:31', '2018-09-10 03:20:31', '<p>• Dri-FIT<sup>®</sup> fabrication wicks perspiration away from the skin for increased evaporation rate<br />\n• Six-panel design with interior taping for a classic look and comfort<br />\n• Adjustable closure at back<br />\n• Snug, custom fit<br />\n• Stretch fit design for security<br />\n• Interior taping for durability<br />\n• Authentic tour logos on side panels<br />\n• TW logo at front and Nike® Swoosh at back<br />\n• Constructed with 58% Cotton and 42% Polyester materials<br />\n• Nike<br />\n• Article 639671-010, 639671-100.</p>', 'TW ULTRALIGHT TOUR CAP BLACK/WHITE', '', 'inherit', 'closed', 'closed', '', '370-autosave-v1', '', '', '2018-09-10 03:20:31', '2018-09-10 03:20:31', '', 370, 'http://golf-warehouse.vn/wp/uncategorized/370-autosave-v1/', 0, 'revision', '', 0),
