(798, 1, '2018-09-11 08:45:50', '2018-09-11 08:45:50', '<p>• 3E fitting – Wider 3E fitting<br />\r\n• BOA System - Keep a more accurate fit and comfort for a long time. Improves the fit and hold of the foot and the shoe with the biologic lock structure<br />\r\n• Front stabilizer / Mizuno wave - Front stabilizer Front stabilizer that suppresses lateral blur occurring at the time of swing. Increase swing stability.<br />\r\n• IG 4f spike (exclusively for Fast Twist<sup>™</sup> ) - Exerts excellent grip power even in movement of the foot in all directions<br />\r\n• 3-D Hold Design - Improves the support performance of the swing as well as support/holding of the feet<br />\r\n• Clarino Softina SK<sup>®</sup> - Soft texture like natural leather and light weight can be made. In addition, special urethane dedicated to golf shoes ensures durability and low water absorption<br />\r\n• D-flex groove - Sole structure that enhances swing stability performance<br />\r\n• Dynamotion Fit - Upper structure compatible with hold performance and bending performance<br />\r\n• Smooth Ride System - Reduces unpleasant tremors that occur between the heel\'s grounding and kicking out, enabling smoother walking<br />\r\n• Mizuno</p>', 'GENEM 007 BOA (EEE) WHITE X BROWN', '', 'publish', 'closed', 'closed', '', 'genem-007-boa-eee-white-x-brown', '', '', '2018-09-11 08:45:50', '2018-09-11 08:45:50', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=798', 0, 'shoes', '', 0),
