(834, 1, '2018-09-12 03:01:38', '2018-09-12 03:01:38', '<p>• Wave platform technology provides a unique midsole design that delivers both cushioning and stability<br />\r\n• Boa Closure System, allowing you to make tiny, precise changes that secure your shoes for an unparalleled, customized fit<br />\r\n• Blends the comfort and support of a high-end running shoe, with the lateral stability and traction needed in golf<br />\r\n• Added durability and traction with Mizuno\'s hardwearing X10 carbon rubber<br />\r\n• Unique shape helps to absorb and disperse the forces as the foot hits the ground, producing a smoother, more cushioned feel on every step<br />\r\n• Patented Wave platform technology to make walking the course as pleasurable and comfortable <br />\r\n• Spikeless design provides convenience without losing traction</p>', 'WAVE CADENCE SPIKELESS LIME X NAVY', '', 'publish', 'closed', 'closed', '', 'wave-cadence-spikeless-lime-x-navy', '', '', '2018-09-12 03:01:38', '2018-09-12 03:01:38', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=834', 0, 'shoes', '', 0),
