(841, 1, '2018-09-12 04:01:01', '2018-09-12 04:01:01', '<p>• BOA Closure System<br />\r\nThe Boa System provides a uniform closure for a comfortable and secure fit, keeping you stable and allowing better access to your shoe’s traction technology. Dial in the perfect fit and don’t give it another thought. The Boa System stays true from the practice range to the 18th green — so you can keep your focus where it matters.<br />\r\n• Stabilizer Wave<br />\r\nFront Stabilizer reduces lateral movement during the swing increasing stability<br />\r\n• Impact Grip System (IG)<br />\r\nFor maximum stability in firm conditions. </p>', 'GOLF SHOES NEXLITE 004 BOA BLACK', '', 'publish', 'closed', 'closed', '', 'golf-shoes-nexlite-004-boa-black', '', '', '2018-09-12 04:01:02', '2018-09-12 04:01:02', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=841', 0, 'shoes', '', 0),
(842, 1, '2018-09-12 04:09:49', '2018-09-12 04:09:49', '<p>The S18 wedge is the newest member in our family of performance wedges with an advanced center of gravity positioning. In the higher lofts, mass is shifted up the blade delivering more consistent spin rates on strikes from high on the clubface (common with more extreme lofts). A true specialist wedge in every aspect (sole grind, profile, beveled top line and groove depth) from the 46-degree pitching wedge replacement to the 62-degree lob wedge in a midsize, rounded profile. Grain Flow Forged with Boron for grooves that stay sharper longer.</p>', 'S18 Wedge *GUN METAL DYNAMIC GOLD WEDGE', '', 'publish', 'closed', 'closed', '', 's18-wedge-gun-metal-dynamic-gold-wedge', '', '', '2018-09-12 04:09:49', '2018-09-12 04:09:49', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=842', 0, 'clubs', '', 0),
