(850, 1, '2018-09-12 07:12:47', '2018-09-12 07:12:47', '<div class=\"product-details section group wrapper\">\r\n<div class=\"col span_7_of_12\">\r\n<div class=\"product-details section group wrapper\">\r\n<div class=\"col span_7_of_12\">\r\n<div class=\"design-specs\">\r\n<h2 class=\"toggle\"><span class=\"header\">Design Details</span></h2>\r\n<div class=\"content mobile-toggle\"><span style=\"color: #0000ff;\">Realizing that spin is critical to optimizing the performance of a fairway wood, we\'ve integrated our NEW infinite Fast Track Technology to allow players the ability to precisely tune their launch and spin</span>performance.</div>\r\n</div>\r\n<div class=\"tech-specs\">\r\n<h2 class=\"toggle\">Tech Specs</h2>\r\n<ul>\r\n	<li><span style=\"color: #0000ff;\"><strong><em>NEW Infinite Fast Track:</em></strong> 15 gram adjustable weight on an unbounded track, yielding unlimited settings to precisely dial in spin and vertical launch parameters.</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong><em>Shockwave Sole: </em></strong>for HIGH COR low on the face for increased ball speeds across the entire face.</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong>NEW More Stable Design:</strong> for our largest sweet area yet</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong>Waffle Crown:</strong> promotes forward and low COG for ease of launch.</span></li>\r\n	<li><span style=\"color: #0000ff;\"><strong>Quick Switch Adaptor:</strong> +/- 2 degrees of loft adjustability.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<h2 class=\"toggle\"> </h2>\r\n<p>&nbsp;</p>', 'JPX-900 FW ADJ. #3 SPEEDER EVOLUTION II', '', 'publish', 'closed', 'closed', '', 'jpx-900-fw-adj-3-speeder-evolution-ii', '', '', '2018-09-12 07:52:55', '2018-09-12 07:52:55', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=850', 0, 'clubs', '', 0),
(851, 1, '2018-09-12 06:34:47', '2018-09-12 06:34:47', '<p>• BOA Closure System<br />\r\nThe Boa System provides a uniform closure for a comfortable and secure fit, keeping you stable and allowing better access to your shoe’s traction technology. Dial in the perfect fit and don’t give it another thought. The Boa System stays true from the practice range to the 18th green — so you can keep your focus where it matters.<br />\r\n• Stabilizer Wave<br />\r\nFront Stabilizer reduces lateral movement during the swing increasing stability<br />\r\n• Impact Grip System (IG)<br />\r\nFor maximum stability in firm conditions. </p>', 'GOLF SHOES NEXLITE 004 BOA WHITE X BLACK', '', 'publish', 'closed', 'closed', '', 'golf-shoes-nexlite-004-boa-white-x-black', '', '', '2018-09-12 06:34:47', '2018-09-12 06:34:47', '', 0, 'http://golf-warehouse.vn/wp/?post_type=shoes&#038;p=851', 0, 'shoes', '', 0),
(885, 1, '2018-09-12 08:02:42', '2018-09-12 08:02:42', '<p>Mizuno NexLite Caddy Bag 5LJC180200 with Mizuno\'s own balance shelf is adopted as a mouth frame. The wide middle iron space prevents the interference of the club up and down, the count display is easy to see, the club is put in and out smoothly. </p>', 'NEXLITE LIMITED EDITION CADDIE BAG', '', 'publish', 'closed', 'closed', '', 'nexlite-limited-edition-caddie-bag', '', '', '2018-09-12 08:02:42', '2018-09-12 08:02:42', '', 0, 'http://golf-warehouse.vn/wp/?post_type=bag&#038;p=885', 0, 'bag', '', 0),
(886, 1, '2018-09-12 08:02:05', '2018-09-12 08:02:05', '<div class=\"add_tabs_custom\">\r\n<div id=\"description_tab_custom\" class=\"tabs_custom current\">\r\n<div class=\"tab_custom\">DESCRIPTION</div>\r\n</div>\r\n</div>\r\n<div class=\"tab_data_custom\">\r\n<div class=\"tab_data_description\">\r\n<div id=\"prod-desc\" class=\"prod-description\">\r\n<div class=\"box-collateral box-description\">\r\n<div class=\"std\">\r\n<p>The Mizuno JPX 900 Hybrid has a new profile design that makes the transition from fairway woods to irons.</p>\r\n<p>A hosel design that can alter the loft by 2° up or down from standard will make distance gapping easier than normal. The sole of the JPX 900 Hybrid features their Shockwave technology which improves forgiveness on off-centre strikes and those that come off low on the face.</p>\r\n<p>The JPX900 is Mizuno’s first adjustable hybrid and has been built like a wood to play like an iron. It has a speed-boosting Shockwave Sole that also places extra mass low in the club for added playability from the turf, and the Quick Switch system that allows loft adjustments to a range of 4 degrees.</p>\r\n<p>It is also set up a little shorter and flatter than previous hybrids to work for players who normally hook their hybrids. The adjustable heads come in lofts 16°, 19°, 22° and 25° to cater for all potential gapping scenarios.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'JPX-900 HYBRID ADJ. #5 Fujikura Pro Hybrid FLEX=S', '', 'publish', 'closed', 'closed', '', 'jpx-900-hybrid-adj-5-fujikura-pro-hybrid-flexs', '', '', '2018-09-12 08:02:05', '2018-09-12 08:02:05', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=886', 0, 'clubs', '', 0),
