(891, 1, '2018-09-12 08:29:49', '2018-09-12 08:29:49', '<p>This is for a set of Mizuno JPX 900 Tour Irons 3-PW with Dynamic Gold AMT S300 Steel shafts.</p>\r\n<div>These are right handed golf clubs.  They are brand new clubs with the heads and grips still wrapped in plastic.</div>\r\n<div>These are beautiful looking irons.  They are the tour version, thin top line and you can shape the ball easily.</div>\r\n<div>These are standard length and lie angle.  They come withe the New Decade black and blue grips.</div>', 'JPX-900 TOUR FGD IRON Dynamic Gold AMT FLEX S300 I#4-PW', '', 'publish', 'closed', 'closed', '', 'jpx-900-tour-fgd-iron-dynamic-gold-amt-flex-s300-i4-pw', '', '', '2018-09-12 08:29:49', '2018-09-12 08:29:49', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=891', 0, 'clubs', '', 0),
