(894, 1, '2018-09-12 09:08:24', '2018-09-12 09:08:24', '<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\">\r\n<div id=\"productDescription_feature_div\" class=\"feature\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription_feature_div\" class=\"a-row feature\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<h2 class=\"default\">Product description</h2>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p>• ITEM CODE: 5KDF(K/T)53770<br />\r\n• STEEL SHAFT: NS PRO 950GH HT <br />\r\n• GRAPHITE SHAFT: PROJECT X LZ GRAPHITE (4.5, 4.0)<br />\r\n• GRIP: M-31<br />\r\n• STANDARD SET: 4-PW, 5-PW<br />\r\n• DEXTERITY: RH<br />\r\n• Grain Flow Forging process delivers soft, solid, consistent feel.<br />\r\n• 1025 Boron is roughly 30% stronger than 1025 allowing thinner, hotter, more extreme geometry.<br />\r\n• Thinnest area of sole extended in both the Toe and Heel directions for more ball speed. <br />\r\n<br />\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'JPX-900 FGD IRON I#5-PW NS PRO950 GH HT FLEX=S', '', 'publish', 'closed', 'closed', '', 'jpx-900-fgd-iron-i5-pw-ns-pro950-gh-ht-flexs', '', '', '2018-09-13 03:24:41', '2018-09-13 03:24:41', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=894', 0, 'clubs', '', 0),
