(946, 1, '2018-09-13 04:21:57', '2018-09-13 04:21:57', '<h3>PRODUCT DETAIL</h3>\r\n<div class=\"product_info_text\">\r\n<p>The Game Changer – Forged from Boron infused steel</p>\r\n<p>A mid-sized, one piece Grain Flow Forged iron that comprehensively ends the normal trade-off between precision and distance. Produced from a stronger Boron infused steel billet – the JPX900 Forged boasts a milled pocket and new multi thickness face for increased ball speeds over a wider area. More compact than its predecessor the JPX900 Forged continues to break the rules with its incredible combination of forged feel and ball speed.</p>\r\n<p>JPX 900 FORGED NO.5-9, P, G, (7 PIECES)</p>\r\n<p>Feature: <br />\r\n- True forged feel in a distance iron : Our new steel reinforced with trace amounts of Boron is 30% stronger, allowing the JPX 900 Forged to perform like a distance iron, without losing its renowned Mizuno forged feel.<br />\r\n- Balanced mid-sized profile: Confidence inspiring behind the ball, yet compacy enough to appeal to elite level players and professionals.<br />\r\n- Ball speed enhancing multi-thickness face: The JPX900 Forged pushes the potential of Boron infused steel to new levels with a multi-thickness face, designed for the fastest ever ball speeds from a Grain Flow Forged Iron. <br />\r\n- High performance from miss-hits: The pocket cavity is extended in both directions to redistribute 21.5 grams to reduce distance loss from off centre hits.<br />\r\n- PowerFrame Design: Mass pushed to the extreme corners delivers stability and performance from miss-hits. A reinforced top line ensures a strong and powerful sound at impact.<br />\r\n- Forged in Hiroshima Japan: At Mizuno\'s exclusive plant - manufacturer of Grain Flow Forged heads for Mizuno for over 30 years. See how each Grain Flow Forged iron is made in our forging story.</p>\r\n</div>', 'JPX-900 FGD IRON I#5-PW NS PRO950 GH HT FLEX=S', '', 'publish', 'closed', 'closed', '', 'jpx-900-fgd-iron-i5-pw-ns-pro950-gh-ht-flexs-2', '', '', '2018-09-13 04:34:35', '2018-09-13 04:34:35', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=946', 0, 'clubs', '', 0),
