(955, 1, '2018-09-13 04:34:20', '2018-09-13 04:34:20', '<h2>Mizuno Men\'s JPX-900 Hot Metal Iron Set - Graphite</h2>\r\n<p><b>Scientifically Crafted for Speed</b><br />\r\nWith the <strong>JPX 900 Hot Metal Iron</strong>, Mizuno set out to Engineer the Longest, Hottest - broad appeal iron we\'ve ever made. By utilizing new materials and new methods of construction, they were able to achieve this, and produced an unmatched level of ball speed.</p>\r\n<h4>Features:</h4>\r\n<ul>\r\n	<li>Chromoly 4140M</li>\r\n	<li>Unitized Cup Face Geometry</li>\r\n	<li>Power Frame</li>\r\n	<li>PX LZ Graphite shaft</li>\r\n	<li>Golf Pride Multi Compound Blue/Black 60round Grip</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4>CHROMOLY 4140M:</h4>\r\n<ul>\r\n	<li>15% stronger material than 17-4 pH Stainless steel provides the added strength for our hottest face ever</li>\r\n	<li>Ultra-thin face combined with our re-engineered CORTECH multi-thickness design provides superior initial ball speed for maximum distance</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4>POWER FRAME:</h4>\r\n<ul>\r\n	<li>More mass is pushed to the extreme perimeter of the club head for industry leading MOI</li>\r\n	<li>POWER FRAME geometry is a result of our Harmonic Impact Technology. The rigid POWER FRAME provided an extremely solid impact sound while allowing maximum face rebound.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4>UNITIZED CUP FACE GEOMETRY:</h4>\r\n<ul>\r\n	<li>Through complex development techniques we were able to achieve Unitized Cup Face Geometry, delivering a massive COR AREA.</li>\r\n	<li>Unitized Cup Face Geometry also provides more discretionary weight than welded cup face designs, thus allowing for a deeper CG and greater forgiveness</li>\r\n</ul>\r\n<p><br />\r\n<strong>Available in Project X LZ Graphite Shaft Flex 4.5 </strong></p>', 'JPX 900 HOT METAL Project X LZ (GRA) 4.5 I#5-PW', '', 'publish', 'closed', 'closed', '', 'jpx-900-hot-metal-project-x-lz-gra-flex-4-5-i5-pw', '', '', '2018-09-13 04:45:38', '2018-09-13 04:45:38', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=955', 0, 'clubs', '', 0),
