(964, 1, '2018-09-13 04:44:44', '2018-09-13 04:44:44', '<h3 dir=\"ltr\">Mizuno Men\'s JPX 900 Hot Metal Irons</h3>\r\n<h2 class=\"PDP-BlueHeadline\" dir=\"ltr\">Longer, Hotter Irons To Appeal To More Golfers</h2>\r\n<p class=\"PDP-SmallDescription\" dir=\"ltr\">Highlighting the design of the JPX 900 Hot Metal irons is the use of Chromoly 4140M, a completely new material being used by Mizuno in the creation of golf clubs. Chromoly is incredibly strong and allows for the Hot Metal irons to be constructed using a one-piece face cup, which leads to incredible ball speeds. In fact, the COR for these irons is 0.83, which is the USGA’s legal limit for a driver. At the same time, however, Chromoly is soft enough that players can still adjust loft and lie angle to their ideal specs, just as they would be able to do with a forged iron. Mizuno’s Power Frame, meanwhile, moves mass to the perimeter of the clubhead to improve forgiveness on mis-hits while also improving sound and feel at impact. And what might be most impressive about the Hot Metal irons is that all of the aforementioned technology and playability has been packed into an iron that has a more compact, elegant appearance than many game-improvement offerings on the market today. The stock shaft options for the JPX 900 Hot Metal irons are the Project X LZ 4.5 in graphite and Nippon NS Pro Modus 105 in steel, but other custom options are available at no upcharge for those who need a different profile.</p>', 'JPX 900 HOT METAL NS PRO 950 GH HT  I#5-PW', '', 'publish', 'closed', 'closed', '', 'jpx-900-hot-metal-ns-pro-950-gh-ht-i5-pw', '', '', '2018-09-13 04:46:31', '2018-09-13 04:46:31', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=964', 0, 'clubs', '', 0),
