(969, 1, '2018-09-13 04:57:56', '2018-09-13 04:57:56', '<h1>T7 White Satin Wedge</h1>\r\n<p>The T7 Wedge revolutionizes spin performance by utilizing Boron Steel in the Grain Flow Forging process coupled with a new ultra high speed CNC process the T7 delivers sharper grooves that last longer.</p>\r\n<p>Features:</p>\r\n<ul>\r\n	<li>Grain Flow Forged 1025 Boron</li>\r\n	<li>NEW Quad Cut Grooves</li>\r\n	<li>Loft Specific Head Shape &amp; Sole Grind</li>\r\n</ul>', 'T7 Wedge *WHITE SATIN BORON  DYNAMIC GOLD WEDGE', '', 'publish', 'closed', 'closed', '', 't7-wedge-white-satin-boron-dynamic-gold-wedge', '', '', '2018-09-13 04:57:56', '2018-09-13 04:57:56', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=969', 0, 'clubs', '', 0),
