(992, 1, '2018-09-13 07:49:37', '2018-09-13 07:49:37', '<p>Mizuno Comfy Grip golf glove looks and performs brilliantly in all conditions, with technological advances in the material to improve the fit and feel. The glove features state of the art - silicon print technology which gives a solid grip in all conditions - rainy, humid or dry weather.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>• Outer Grip used on palm parts where stronger grip is required<br />\r\n• Silicon print processing on the palm side of leather prevents slipping from sweat or rain, and also supports grip<br />\r\n• With high degree of adhesion, the silicon print processing helps the glove fit better</p>', 'COMFY LEATHER (Left Hand)', '', 'publish', 'closed', 'closed', '', 'comfy-leather-left-hand', '', '', '2018-09-13 07:49:37', '2018-09-13 07:49:37', '', 0, 'http://golf-warehouse.vn/wp/?post_type=accessories&#038;p=992', 0, 'accessories', '', 0),
