(995, 1, '2018-09-13 09:20:06', '2018-09-13 09:20:06', '<p>MP-18 MB</p>\r\n<p> ITEM CODE: 5KDFS30107R3</p>\r\n<p> The MP-18 was designed as a throwback to the muscle-backs of Mizuno\'s past. A shorter blade length, cambered top line and steep progression into sharp, compact wedges are the marks of our master clubmakers - who honed their skills on the irons of major winners. Grain Flow Forged for the most intensive feedback imaginable. In relation to previous Mizuno MP Muscle Back irons, the MP-18 irons are significantly smaller than the MP-5 irons and slightly smaller than one of Mizuno’s smallest modern Muscle Back irons, the MP-4. Their toplines appear thinner than they measure due to a camber that makes them look slimmer in the address position. In comparing topline thicknesses, the MP-18’s are thinner than the MP-5, but they’re a bit thicker than the MP-4.  The MP-18 irons will come stocked with True Temper Dynamic Gold shafts &amp; Nippon N.S. Pro shafts with Golf Pride Mizuno M31 Grips. They are right-handed only offerings.</p>\r\n<p>Features &amp; Technologies </p>\r\n<p>-1025E Pure Select: Six times tighter tolerance than industry standard for greater purity. </p>\r\n<p>-Grain Flow Forged HD: Enhanced Grain Flow Forging process that increases grain density in the impact area for the ultimate soft, solid, consistent feel. </p>\r\n<p>-Harmonic Impact Technology: Fine-tuned head geometry delivers ideal impact feel and feedback. </p>\r\n<p>-Satin Nickel Chrome Finish: An elegant, yet durable non-glare finish.</p>', 'MP18 MB (MUSCLE BACK) DYNAMIC GOLD R300 I#4-PW', '', 'publish', 'closed', 'closed', '', 'mp18-mb-muscle-back-dynamic-gold-r300-i4-pw', '', '', '2018-09-13 09:34:08', '2018-09-13 09:34:08', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=995', 0, 'clubs', '', 0),
