(1017, 1, '2018-09-14 02:23:29', '2018-09-14 02:23:29', '<p>The TENSEI™ CK Orange builds off of MCA GOLF’s classic, smooth bend profile and incorporates the same Carbon Fiber/DuPont™ Kevlar® (CK) weave found in the butt-section of all TENSEI™ CK shafts – providing enhanced stability and maximum feel, in an extremely versatile design.</p>\r\n<p>Unlike other shafts TENSEI™ CK Series family, TENSEI™ CK Orange has a unique counter balanced design for player’s looking to fine-tune their golf club performance.</p>\r\n<p>DuPont™ Kevlar® is a trademark or registered trademark of E.  I. du Pont de Nemours &amp; Company</p>', 'ST180 DRIVER MRC TENSEI CK Orange 50 55R/50 57S', '', 'publish', 'closed', 'closed', '', 'st180-driver-mrc-tensei-ck-orange-50-55r-50-57s', '', '', '2018-09-14 02:23:29', '2018-09-14 02:23:29', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=1017', 0, 'clubs', '', 0),
