(1020, 1, '2018-09-14 02:35:49', '2018-09-14 02:35:49', '<h2>The Mizuno Mens ST180 Fairway Wood incorporates the incredible Wave sole technology that will produce low spin, a controlled ball flight and maximum versatility.</h2>\r\n<hr />\r\n<p>Mizuno have used their amplified Wave sole technology to increase energy transfer to the face at impact. This is achieved by the sole contracting and expanding. To maximise energy return a high-speed 1770 Maraging steel face has been used to increase ball speeds across the whole face, producing incredible distance. <br />\r\n<br />\r\nTo provide maximum confidence at address Mizuno have used a wider, larger profile. Normally you would associate a larger fairway with high spin numbers but not in the case of the ST180 Fairway. <br />\r\n<br />\r\nThe low spin numbers, maximum forgiveness, incredible ball speeds and confidence inspiring head shape will redefine how players look at fairway woods in the future. <br />\r\n<br />\r\nAn adjustable hosel design will allow you to choose from a variety of lofts and lie settings that will provide the fine-tuning needed to fill distance gaps in your long clubs, whilst seeking the trajectory that suits your swing. </p>', 'ST180 FW MRC TENSEI CK Blue 55 58R #3/ 60S #5', '', 'publish', 'closed', 'closed', '', 'st180-fw-mrc-tensei-ck-blue-55-58r-3-60s-5', '', '', '2018-09-14 02:35:49', '2018-09-14 02:35:49', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=1020', 0, 'clubs', '', 0),
