(1045, 1, '2018-09-14 03:53:53', '2018-09-14 03:53:53', '<p>The Mizuno GX Hybrids feature a slightly shallow head profile. With hybrids, you really need a versatile club that you can rely on to deliver the shots that you envision from 180+ yards. And then in times of trouble, to be that trusty rescue club to get you out of the situation quickly and safely. The GX Hybrid will provide just that. Hybrids are one category where the shape of the head can vary significantly from one brand to another. Some are so unique and unorthodox that looking at it takes getting used to. No worries on these Mizuno GX Hybrids. These GX Hybrids are shaped very traditionally so that literally anyone can get used to the shape on the first try. There is a forgiveness factor that will welcome beginner golfers to give it a go. A shallow profile combined with a forged maraging steel face, the GX hybrid promises to deliver controlled high trajectory shots that easily stops on the green with just one hop. You will start to look forward to longer approach shots. GX Hybrids are offered in 3 (19 deg) , 4 (21 deg) , 5 (23 deg)and 6 (25 deg) with MFUSION shaft as standard.</p>', 'GX HYBRID MFUSION H 44SR #3/#4', '', 'publish', 'closed', 'closed', '', 'gx-hybrid-mfusion-h-44sr-3-4', '', '', '2018-09-14 08:15:00', '2018-09-14 08:15:00', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=1045', 0, 'clubs', '', 0),
