(1081, 1, '2018-09-17 03:45:28', '2018-09-17 03:45:28', '<h4>MIZUNO GX FORGED WEDGE</h4>\r\n<p>Introducing the New Mizuno GX Forged Wedge for 2018. This wedge is listed separately from the iron just in case you want to buy only the wedges</p>\r\n<p>These wedges feature a full 1025 Boron Grain Flow Forged heads with lofts that match nicely with the rest of the irons.   There is also some offset which transitions nicely from the iron set. </p>\r\n<h4>FEATURES</h4>\r\n<p><strong>Soft iron boron steel with both flight and hit feel</strong></p>\r\n<p>Made of soft iron boron steel containing 0.003% boron in soft iron. By quenching only the face during forging, the face strength is increased by 30%. High repulsion by high strength thin face, mild hit feeling unique to soft iron forged iron was compatible.</p>', 'GX FORGED IRON I#SW/GW MFUSION I SR/R I#SW/GW', '', 'publish', 'closed', 'closed', '', 'gx-forged-iron-isw-mfusion-i-sr-r-isw', '', '', '2018-09-17 03:50:34', '2018-09-17 03:50:34', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=1081', 0, 'clubs', '', 0),
