(1085, 1, '2018-09-17 03:48:53', '2018-09-17 03:48:53', '<h4>MIZUNO GX FORGED WEDGE</h4>\n<p>Introducing the New Mizuno GX Forged Wedge for 2018. This wedge is listed separately from the iron just in case you want to buy only the wedges</p>\n<p>These wedges feature a full 1025 Boron Grain Flow Forged heads with lofts that match nicely with the rest of the irons.   There is also some offset which transitions nicely from the iron set. </p>\n<h4>FEATURES</h4>\n<p><strong>Soft iron boron steel with both flight and hit feel</strong></p>\n<p>Made of soft iron boron steel containing 0.003% boron in soft iron. By quenching only the face during forging, the face strength is increased by 30%. High repulsion by high strength thin face, mild hit feeling unique to soft iron forged iron was compatible.</p>', 'GX FORGED IRON I#SW/GW MFUSION I SR/R I#SW/GW', '', 'inherit', 'closed', 'closed', '', '1081-autosave-v1', '', '', '2018-09-17 03:48:53', '2018-09-17 03:48:53', '', 1081, 'http://golf-warehouse.vn/wp/uncategorized/1081-autosave-v1/', 0, 'revision', '', 0),
(1086, 1, '2018-09-17 07:29:47', '2018-09-17 07:29:47', '<h3>PRODUCT DETAIL</h3>\r\n<div class=\"product_info_text\">\r\n<p><strong>Shaft:</strong> MFUSION i SR.R</p>\r\n<p><strong>Grip</strong>: New Light Weight</p>\r\n<p><strong>Head</strong>: RH</p>\r\n<hr />\r\n<p><b>GX Titanimum - better strength  &amp; distance</b></p>\r\n<p>Latest GX series offer an alternative for golf professional requiring enhanced strength and lightweight structure. GX Ti face is made of titanimum head, which contribute to increase in power and striking distance.  Combined with MFUSION shaft, its strength and forgiveness is beyond doubt. </p>\r\n<p><strong>MFUSION Shaft</strong></p>\r\n<p>-Special surface treatment before combining carbon fiber reinforced polymer for strength and carbon nanotube for light weight.</p>\r\n<p>-Golfers can create more ball speed and stability due to the shaft’s light weight and strength.</p>\r\n</div>', 'GX TI FACE IRON I#5-PW MFUSION I SR/R I#5-SW/GW', '', 'publish', 'closed', 'closed', '', 'gx-ti-face-iron-i5-pw-mfusion-i-sr-i5-pw', '', '', '2018-09-17 08:06:45', '2018-09-17 08:06:45', '', 0, 'http://golf-warehouse.vn/wp/?post_type=clubs&#038;p=1086', 0, 'clubs', '', 0),
(1092, 1, '2018-09-17 07:34:37', '2018-09-17 07:34:37', '<h3>PRODUCT DETAIL</h3>\n<div class=\"product_info_text\">\n<p><strong>Shaft:</strong> MFUSION i SR.R</p>\n<p><strong>Grip</strong>: New Light Weight</p>\n<p><strong>Head</strong>: RH</p>\n<hr />\n<p><b>GX Titanimum - better strength  &amp; distance</b></p>\n<p>Latest GX series offer an alternative for golf professional requiring enhanced strength and lightweight structure. GX Ti face is made of titanimum head, which contribute to increase in power and striking distance.  Combined with MFUSION shaft, its strength and forgiveness is beyond doubt. </p>\n<p><strong>MFUSION Shaft</strong></p>\n<p>-Special surface treatment before combining carbon fiber reinforced polymer for strength and carbon nanotube for light weight.</p>\n<p>-Golfers can create more ball speed and stability due to the shaft’s light weight and strength.</p>\n</div>', 'GX TI FACE IRON I#5-PW MFUSION I SR/R I#5-SW/GW', '', 'inherit', 'closed', 'closed', '', '1086-autosave-v1', '', '', '2018-09-17 07:34:37', '2018-09-17 07:34:37', '', 1086, 'http://golf-warehouse.vn/wp/uncategorized/1086-autosave-v1/', 0, 'revision', '', 0),
